    <script>
// for control the sound of game background .............By:Manya Goyal ........................   
         const audio = document.getElementById("myAudio");
           const button = document.getElementById("Sbtn");
           window.onload = function () {
            audio.play();
        };

function toggleAudio() {
    if (audio.paused) {
        audio.play();
        button.src="Images/S2.jpg";
    } else {
        audio.pause();
        button.src="Images/S1.jpg";
    }
}

    </script>
